function Main({ handleEditAvatarClick, handleEditProfileClick, handleAddPlaceClick }) {
    function handleEditAvatarClick() {
        document.querySelector('.popup_type_avatar').classList.add('popup_opened');
    };

    function handleEditProfileClick() {
        document.querySelector('.popup_type_edit').classList.add('popup_opened');
    };

    function handleAddPlaceClick() {
        document.querySelector('.popup_type_add-card').classList.add('popup_opened');
    };
    return ( <
        main className = "main-content" >
        <
        section className = "profile" >
        <
        div className = "profile__container" >
        <
        img src = "#"
        className = "profile__avatar"
        alt = "Аватар" / >
        <
        button type = "button"
        className = "profile__pen"
        onClick = { handleEditAvatarClick } > < /button> <
        div className = "profile__info" >
        <
        div className = "profile__content" >
        <
        h1 className = "profile__name" > Жак - Ив Кусто < /h1> <
        button type = "button"
        className = "profile__button"
        onClick = { handleEditProfileClick } > < /button> <
        /div> <
        p className = "profile__job" > Исследователь океана < /p> <
        /div> <
        /div> <
        button type = "button"
        className = "profile__button-plus"
        onClick = { handleAddPlaceClick } > < /button>

        <
        /section> <
        section className = "card" >

        <
        /section> <
        /main>
    )
}
export default Main
